function rawdata = importfile_eeg101(filename, startRow, endRow)
%IMPORTFILE Import numeric data from a text file as a matrix.

% Example:
%   rawdata = importfile('improbotics_closing2min_june16_2018.csv');
%
%    See also TEXTSCAN.

% Auto-generated by MATLAB on 2018/06/18 11:35:46

%% Initialize variables.
delimiter = ',';
if nargin<=2
    startRow = 2;
    endRow = inf;
